import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import Table from "@material-ui/core/Table";
import TableBody from "@material-ui/core/TableBody";
import TableCell from "@material-ui/core/TableCell";
import TableContainer from "@material-ui/core/TableContainer";
import TableHead from "@material-ui/core/TableHead";
import TableRow from "@material-ui/core/TableRow";
import Paper from "@material-ui/core/Paper";
import { useDispatch, useSelector } from "react-redux";
import { setEspecialidad } from "actions/EspecialidadActions";
import { confirmAlert } from "react-confirm-alert"; // Import

export default function ConfiguracionHorarioTable() {
  const classes = useStyles();
  const dispatch = useDispatch();

  const configuracionHorario = useSelector((state) => state.horario.horario);

  const editConfiguracionHorario = (
    cd_configuracion,
    intervalo,
    hora_desde,
    hora_hasta
  ) => {
    dispatch(
      setEspecialidad({
        cd_configuracion: cd_configuracion,
        intervalo: intervalo,
        hora_desde: hora_desde,
        hora_hasta: hora_hasta,
      })
    );
  };

  return (
    <TableContainer component={Paper}>
      <Table aria-label="simple table">
        <TableHead>
          <TableRow>
            <TableCell className={classes.titleTable}>Intervalo</TableCell>
            <TableCell className={classes.titleTable}>Hora Inicio</TableCell>
            <TableCell className={classes.titleTable}>Hora Fin</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          <TableRow
            key={especialidad.nombre}
            className={classes.rowTable}
            onClick={() =>
              editEspecialidad(
                configuracionHorario.cd_configuracion,
                configuracionHorario.intervalo,
                configuracionHorario.horaDesde,
                configuracionHorario.horaHasta
              )
            }
          >
            <TableCell component="th" scope="row">
              {configuracionHorario.intervalo}
            </TableCell>
            <TableCell component="th" scope="row">
              {configuracionHorario.horaDesde}
            </TableCell>
            <TableCell component="th" scope="row">
              {configuracionHorario.horaHasta}
            </TableCell>
          </TableRow>
        </TableBody>
      </Table>
    </TableContainer>
  );
}

const useStyles = makeStyles((theme) => ({
  table: {
    minWidth: 650,
  },
  titleTable: {
    fontSize: 16,
    textAlign: "center",
  },
  rowTable: {
    "&:hover": {
      backgroundColor: "#eeeeee",
      color: theme.palette.primary.main,
      cursor: "pointer",
    },
  },
}));
